MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibrepxOPC is the Siemens EDA inverse lithography tool.");
MGCAddSnippet(5, "Calibre pxOPC is a third-generation mask optimization tool for small and medium-sized layouts. It optimizes every pixel on the mask for maximum process window, taking into consideration depth of focus (DOF), exposure latitude, and mask error enhancement factors (MEEF) for both shapes and sub-resolution assist features (SRAFs). ");
MGCAddSnippet(6, "Calibre pxOPC can be used in several ways: on its own to develop design rules, to improve the OPC results of other products, or to create SRAF templates. ");
MGCAddSnippet(7, "The feature that differentiates Calibre pxOPC from the other Calibre OPC and SRAF offerings is the sequential execution of jobs. Each job, because it performs a specific task, can be held to a  contract . A contract is a measurable result that must be met before advancing to the next job. The final pxOPC result is defective if and only if one of the contracts was not satisfied.");
MGCAddSnippet(8, "To use Calibre pxOPC, you must set up your environment and files properly.");
MGCAddSnippet(9, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(10, "Calibre pxOPC is usually run in batch mode, which requires an SVRF file to be processed by the Calibre hierarchical platform (calibre ‑drc). The processing is invoked from a shell command line. ");
MGCAddSnippet(11, "The following key sections are covered in this chapter.");
MGCAddSnippet(12, "Calibre pxOPC is run through a litho setup file with pxOPC commands. This can be called either from an SVRF file or from the Calibre WORKbench RET Flow Tool. Setup and SVRF files are created with a text editor. This section provides example files at the end that you can copy into your editor.");
MGCAddSnippet(13, "The Calibre pxOPC Template Wizard creates an initial pxOPC recipe that includes typical main optimization metrics such as MRC and extra print control. The generated pxOPC recipe is a good starting point that the user can tune for optimal results.");
MGCAddSnippet(14, "You can run Calibre pxOPC files three ways, two of them from the command line and one from Calibre WORKbench. ");
MGCAddSnippet(15, "The RET Flow Tool can provide a template setup file for you to start with. You can iteratively tune settings on a small section of layout without the need of an SVRF file.");
MGCAddSnippet(16, "You can run Calibre pxOPC from the command line, as with any other Calibre product. This is the fastest method if you want to run on the full layout.");
MGCAddSnippet(17, "Calibre Local Printability Enhancement, or Calibre LPE, runs Calibre pxOPC on marked regions of a full-chip layout.");
MGCAddSnippet(18, "Calibre pxOPC is designed to provide reasonable results for many situations with no or minute customizations. To determine where the customizations are needed, each step (job) is checked against its contract. To best know where to tune, first you must see where the contracts are not being met by default settings.");
MGCAddSnippet(19, "If you notice that the wrong layer received OPC correction, or that the process window conditions were not aggressive enough, you need to fix the general section of the pxopc_options block.");
MGCAddSnippet(20, "The Open job reshapes (or  opens ) the main layout features so that they print under nominal conditions. The contract of the Open job is to deliver printed shapes at nominal conditions. Contacts deviate no more than 30% and lines no more than 40% from the target critical dimension (CD).");
MGCAddSnippet(21, "The Decorate job generates SRAFs intended to deliver the maximum process window. If the optimization is limited to one process condition, then the dose latitude is optimized. The contract of the Decorate job is that it generates at least two rows of generally correct assist features. The SRAFs are robust and in dark areas. (Dark areas are outside the target for dark backgrounds, and inside the target for clear backgrounds.)");
MGCAddSnippet(22, "The Correct job corrects the printing and EPE distribution. It reduces PV bands and brings contours closer to design targets. After Correct runs, there may still be line end pullback, but there are no catastrophic failures. ");
MGCAddSnippet(23, "The Refine job improves the output of the Correct job by doing pixel-based optimization. Because some areas are more important to resolve than others, critical EPE sites can be emphasized with weighted shapes. ");
MGCAddSnippet(24, "The Litho-Mask Rule Constraint (LMRC) job converts the mask back from contours to Manhattan shapes of predefined edge lengths. It then performs litho simulations to detect assist features that print and adjusts the mask to fix this. ");
MGCAddSnippet(25, "The Detail job runs fine-grained optimization for the best EPE RMS, meaning that EPE distribution is centered and shrunken while maintaining an MRC-clean mask. The mask is represented as Manhattan polygons. ");
MGCAddSnippet(26, "The CDOF job optimizes the mask to improve the common process window, a lithographic measure of manufacturing robustness. A good common process window should allow some variation in dose and a wide range of defocus while still keeping EPE within tolerance. ");
MGCAddSnippet(27, "The EL job optimizes the mask to improve the exposure latitude (EL). Exposure latitude is also referred to as dose latitude, and affects image-log slope (ILS). ");
MGCAddSnippet(28, "Occasionally Calibre OPCverify may show pinching, bridging, or SRAF printing that Calibre pxOPC simulations do not. Generally this is because the two setup files use different parameters.");
MGCAddSnippet(29, "When working with complex designs, you may desire a faster result. This procedure offers some tips for improving execution time.");
MGCAddSnippet(30, "The pxOPC transcript analyzer is available in the CalibreDESIGNrev, CalibreMDPview, Calibre LITHOview, and Calibre WORKbench viewers. It calls Gnuplot to display graphs of the rate and objective.");
MGCAddSnippet(31, "This chapter contains descriptions for the commands used by Calibre pxOPC. The commands are grouped by their location in a rule file.");
MGCAddSnippet(32, "There are two SVRF commands used by Calibre pxOPC.");
MGCAddSnippet(33, "Specifies a Litho setup file in the SVRF rule file for use by Calibre Litho/RET tools.");
MGCAddSnippet(34, "Invokes Calibre pxOPC. ");
MGCAddSnippet(35, "The inline_file argument to RET PXOPC specifies an in-line Litho File setup file containing a command initialization block. Commands in this block are lowercase only. The following commands may appear in the setup file, specified one per line.");
MGCAddSnippet(36, "Loads a domain decomposition method (DDM) model.");
MGCAddSnippet(37, "Enables direct data entry (DDE), which can improve run time in some cases. Requires litho flat processing mode.");
MGCAddSnippet(38, "Enables direct data output (DDO), which can improve run time in some cases. Requires litho flat processing mode.");
MGCAddSnippet(39, "Centers the field for EUV black border models that include the field_size keyword.");
MGCAddSnippet(40, "Sets a placement X-coordinate for EUV through-slit and shadow bias models. ");
MGCAddSnippet(41, "Associates a precomputed long range flare convolution with a flare model contained inside a litho model.");
