MGCAddSnippet(60, "Scales print image from positive assist features.");
MGCAddSnippet(61, "Enables automatic calculation of tile size.");
MGCAddSnippet(62, "Defines background transmission characteristics for each exposure. Up to two exposures can be defined.");
