MGCAddSnippet(116, "Performs additional bridging correction for shapes within a specific pw_condition.");
MGCAddSnippet(117, "Creates print image conditions for dose, focus, resist, and aerial threshold.");
MGCAddSnippet(118, "Creates a named set of automatically generated conditions based on specified process window parameters. The conditions are only accessible as a group; not individually.");
MGCAddSnippet(119, "Controls the relative emphasis given to the dose latitude during process window optimization.");
