MGCAddSnippet(139, "Determines which process window condition group to optimize. Required when two or more process window condition groups are defined.");
MGCAddSnippet(140, "Sets the default weight.");
MGCAddSnippet(141, "Identifies polygon layers which define more important areas for optimization.");
MGCAddSnippet(142, "This chapter provides examples for some common situations. Each example includes the SVRF lines that call the Calibre RET tools.");
MGCAddSnippet(143, "The setlayer curve command is commonly used to create a smoothed target for post-tapeout operations.");
MGCAddSnippet(144, "Foundries commonly combine different Calibre operations such as biasing, OPC, and ORC within a single SVRF rule file. The different litho setup files can be either external or included in the SVRF rule file with each in its own LITHO FILE statement.");
MGCAddSnippet(145, "Calibre pxOPC can be used in place of CalibrePixBAR to create templates for use in CalibrenmSRAF.");
MGCAddSnippet(146, "This example shows a setup file you might use to start optimizing a recipe for double patterning. There are two target layers, and different optical and DDM models for each. ");
MGCAddSnippet(147, "EUV Calibre setups are similar to DUV setups, requiring only a few extra commands and an EUV license.");
MGCAddSnippet(148, "CDOF jobs can adjust a mask to improve the range of focus conditions at which the design is printed properly. They do not change the source or the optical model.");
MGCAddSnippet(149, "Calibre pxOPC has been tuned so that in most cases only small customizations are needed. The best practice recommendations are built around typical sequences of jobs.");
MGCAddSnippet(150, "Calibre pxOPC can be run either standalone (for example, when developing an optimization recipe or SRAF template) or as part of a larger optimization flow (for example, when called from Calibre LPE). The best practices have been tested with both types of flow.");
MGCAddSnippet(151, "For a correctly optimized mask, every job must deliver certain measurable results (the contract). A bad result can be traced back to the first job that does not fulfill its contract. ");
MGCAddSnippet(152, "Extra printing happens when assist features such as SRAFs that are not meant to appear on the wafer generate a contour. The method to control extra printing depends on the associated process window condition.");
MGCAddSnippet(153, "Ripples, or oscillating contours, sometimes appear when too much emphasis is placed on reducing corner rounding. The smoothed target has straight edges and round corners, but the printing contour has wavy edges and looser corners.");
MGCAddSnippet(154, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

